using Components;using System;using MessagePack;using HECSFramework.Serialize;using Commands;namespace HECSFramework.Core{	[MessagePackObject, Serializable]	public struct TargetSceneComponentResolver : IResolver<TargetSceneComponent>, IResolver<TargetSceneComponentResolver,TargetSceneComponent>, IData	{		public TargetSceneComponentResolver In(ref TargetSceneComponent targetscenecomponent)		{			return this;		}		public void Out(ref IEntity entity)		{			var local = entity.GetTargetSceneComponent();			Out(ref local);		}		public void Out(ref TargetSceneComponent targetscenecomponent)		{		}	}}